import "./topbar.css";

export default function topbar() {
  return (
    <div className='top'>
    <div className="topLeft"><i class="fa-brands fa-facebook"></i>
    <i class="fa-brands fa-twitter"></i>
    <i class="fa-brands fa-pinterest"></i></div>
    <dix className="topCentre"><i class="fa-brands fa-twitter"></i></dix>
    <dix className="topRight">r</dix>

    </div>
  )
}
